import { Link } from "react-router-dom";
import MainNavBar from "../components/MainNavBar";

function LandingPage() {
    return (
        <>
            <MainNavBar />
            <h1>Landing Page</h1>
            <p>
                Go to <Link to='/calendar'>the calendar</Link>
            </p>
        </>
    )
}

export {LandingPage};
